import { withAuth } from '../contexts/auth'
import { Pages } from '../models'

function addProviders(Component: React.ElementType & { displayName?: string }) {
  switch (Component.displayName) {
    case Pages.Home:
      return withAuth(Component)
    default:
      return Component
  }
}

export { addProviders }
